INSERT INTO `SAMPLE` VALUES (367,'2011-02-23','2009-01-01','United Kingdom; Norwich',1,'2010-02-15 00:00:00.000000','The roots of 4 week old wheat plants were loosely shaken to remove bulk soil, then placed in 50ml falcon tubes and shaken vigorously. Roots were removed and remaning  \"rhizosphere\" soil was used to extract RNA using the POwerSoil RNA isolation kit(MoBio).','2011-03-16 00:00:00.000000','2011-01-25 00:00:00.000000','terrestrial biome','rhizosphere','soil','Wheat Rhizosphere soil from John Innes Centre','Wheat-MID3-MID6 rhizosphere mRNA enriched',NULL,'ERS025421',NULL,52.6228,1.2180,'2015-08-13 15:30:56.000000','Webin-804',220,'SAMEA691121'),(370,'2011-04-21',NULL,'Puerto Rico; Luquillo Experimental Forest, Bisley watershed',1,'2011-01-03 00:00:00.000000','Soil metagenome extracted from rainforest soil. The tropical forest soil sample used for metagenome sequencing was collected in a subtropical lower montane wet forest in the Luquillo Experimental Forest (18.30N, 65.83W), which is part of the NSF-sponsored Long-Term Ecological Research program in Puerto Rico. The climate in this region is relatively aseasonal, with mean annual rainfall of 4500 mm and mean annual temperatures of 22C to 24C. Soils were collected from the Bisley watershed approximately 250 meters above sea level from the 0-10 cm depth using a 2.5 cm diameter soil corer. Sampling date: Summer 2008','2001-01-01 00:00:00.000000','2001-01-01 00:00:00.000000','Tropical and subtropical moist broadleaf forest biome','forest soil','soil','Puerto Rico Rainforest soil metagenome','Puerto_Rico_Rainforest_soil_metagenome',NULL,'SRS009922',NULL,18.3000,-65.8300,'2015-08-13 15:30:55.000000',NULL,250,'SAMN00008167'),(371,'2011-04-21','2005-06-01','Germany',1,'2011-01-04 00:00:00.000000','454 Sequencing of The Glacier Ice Metagenome Of The Northern Schneeferner','2001-01-01 00:00:00.000000','2001-01-01 00:00:00.000000','freshwater biome','alpine glacier','fresh water','Glacier Metagenome','Glacier Metag