9.000000','Webin-31235',132,'SAMEA3275643'),(5851,'2015-03-03','2014-06-20',NULL,1,'2015-03-01 00:00:00.000000','Our objective is to contribute to the OSD dataset on marine microbial diversity and functions and possibly its analysis. We are particularly interested by the structure and fucntions of prokaryotic and eukaryotic communities and their in situ interactions.','2015-03-01 00:00:00.000000','2015-03-01 00:00:00.000000','marine biome','surface water','seawater','OSD2_2014-06-20_0m_NPL022','36',NULL,'ERS667667',NULL,48.7778,-3.9375,'2015-11-02 10:34:29.000000','Webin-31235',132,'SAMEA3275645'),(5852,'2015-03-03','2014-06-21',NULL,1,'2015-03-01 00:00:00.000000','To collect surface seawater on the summer solstice day from the L4 mooring in the Western English Channel (OSD1) and to filter the water using the standardized protocol NPL022. The filters will be sent to Germany and subsequently processed and analysed for the prokariotic fraction. The results will be part of the global campaign OSD data-set which will allow the scientific community to better understand the microbial diversity and function in the light of climate change assessment. The data-set so established will be used as a reference for future studies and the base for developing biotechnologies.','2015-03-01 00:00:00.000000','2015-03-01 00:00:00.000000','ENVO: 01000023','ENVO: 00002042','ENVO: 00002149','OSD1_2014-06-21_0m_NPL022','13',NULL,'ERS667668',NULL,50.1510,-4.1300,'2015-11-02 10:34:29.000000','Webin-31235',132,'SAMEA3275646'),(6528,'2015-04-20','2015-06-13',NULL,1,'2015-04-14 00:00:00.000000','OSD164_2014-06-13_2m_NPL022','2015-04-14 00:00:00.000000','2015-04-14 00:00:00.000000','ENVO:00000447','ENVO:00002042','ENVO:00002010','OSD164_2014-06-13_2m_NPL022','269',NULL,'ERS702154',NULL,60.1433,-1.2825,'2015-11-02 10:34:29.000000','Webin-31235',132,'SAMEA3340641'),(9925,'2015-07-31',NULL,'USA',1,'2012-06-04 00:00:00.000000','\"Bulk soil in which plant was not present; 454 sequencing plate code: 3